// ==UserScript==
// @name           Google Gel Logo
// @namespace      http://twitter.com/MaxEvans
// @description    Replaces Google's logo with a gel like logo. Based on Max Evans' Google logo design.
// @include        http://*.google.com/*
// @copyright      Max Evans
// ==/UserScript==

var logo = document.evaluate("//img[contains(@src, '/intl/en_ALL/images/logo.gif')]", document, null, 9, null).singleNodeValue;

if(logo) {
logo.src = "data:image/png;base64,%3D";
}



var nav3 = document.evaluate("//img[contains(@src, '/images/nav_logo3.png')]", document, null, 9, null).singleNodeValue;

if(nav3) {
nav3.src = "data:image/png;base64,%3D";
}


var nav4 = document.evaluate("//img[contains(@src, '/images/nav_logo4.png')]", document, null, 9, null).singleNodeValue;

if(nav4) {
nav4.src = "data:image/png;base64,%3D%3D";
}